import React from "react";
import { Route, Routes } from "react-router-dom";
import Home from "./"

const App = () => {
  return (
     <div>

      <div>
        <Navbar />
      </div>

      <div>
         <Routes>
            <Route path="/" element={<Home />}/>
            <Route path="/cart" element={<Cart />}/>
         </Routes>
      </div>

     </div>
  )
};

export default App;
